import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
import '../../styles/SharedStyles.css';

function StudentReportView() {
    const { studentId } = useParams();
    const [reportData, setReportData] = useState(null);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        async function fetchData() {
            try {
                const token = localStorage.getItem('token');
                const response = await axios.get(
                    `http://localhost:5000/api/student-report/${studentId}`,
                    { headers: { Authorization: `Bearer ${token}` } }
                );
                setReportData(response.data);
            } catch (error) {
                console.error('Error fetching data:', error);
                setReportData(null);
            } finally {
                setLoading(false);
            }
        }
        fetchData();
    }, [studentId]);

    if (loading) {
        return (
            <div className="dashboard-container" style={{ textAlign: 'center', padding: '4rem' }}>
                <div className="loading-spinner"></div>
                <p>Loading report data...</p>
            </div>
        );
    }

    if (!reportData || !reportData.feedback || reportData.feedback.length === 0) {
        return (
            <div className="dashboard-container" style={{ textAlign: 'center', padding: '4rem' }}>
                <h2>No Feedback Available</h2>
                <p>No feedback data has been submitted for this student yet.</p>
            </div>
        );
    }

    return (
        <div className="dashboard-container">
            <div className="dashboard-header">
                <h1 className="dashboard-title">Student Feedback Report</h1>
                <div className="stats-card" style={{ maxWidth: '600px', margin: '2rem auto' }}>
                    <h2>{reportData.studentName}</h2>
                    <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3, 1fr)', gap: '2rem', marginTop: '1rem' }}>
                        <div className="stats-item">
                            <div className="stats-label">USN</div>
                            <div className="stats-value">{reportData.usn}</div>
                        </div>
                        <div className="stats-item">
                            <div className="stats-label">Course</div>
                            <div className="stats-value">{reportData.course}</div>
                        </div>
                        <div className="stats-item">
                            <div className="stats-label">Semester</div>
                            <div className="stats-value">{reportData.semester}</div>
                        </div>
                    </div>
                </div>
            </div>

            {reportData.feedback.map((facultyFeedback, index) => (
                <div key={index} className="dashboard-card" style={{ marginBottom: '2rem' }}>
                    <h2 className="dashboard-card-header">{facultyFeedback.facultyDetails}</h2>
                    <table className="dashboard-table">
                        <thead>
                            <tr>
                                <th>Question</th>
                                <th style={{ width: '100px' }}>Score</th>
                                <th>Comment</th>
                            </tr>
                        </thead>
                        <tbody>
                            {facultyFeedback.feedbackItems.map((item, idx) => (
                                <tr key={idx}>
                                    <td>{item.question}</td>
                                    <td style={{ textAlign: 'center' }}>
                                        <span className="score-badge" 
                                              style={{ 
                                                  background: getScoreColor(item.score),
                                                  padding: '0.25rem 0.75rem',
                                                  borderRadius: '12px',
                                                  color: 'white'
                                              }}>
                                            {item.score}
                                        </span>
                                    </td>
                                    <td>{item.comment || '-'}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            ))}
        </div>
    );
}

function getScoreColor(score) {
    const colors = {
        1: '#dc3545',
        2: '#ffc107',
        3: '#6c757d',
        4: '#28a745',
        5: '#003087'
    };
    return colors[score] || '#6c757d';
}

export default StudentReportView;
